import React from "react";

function DisplayInfo(props) {
  const { header, message, img } = props;
  return (
    <div>
      <h1>{header}</h1>
      <p>{message}</p>
      <img src={img} alt={"some image"} />
    </div>
  );
}

export default DisplayInfo;
